import React from "react";
import "./Navbar.css";

function Navbar(props) {
  return (
    <div>
      <div className="navbar">
        <a href="/" className="navbar__name">
          {props.name}
        </a>
        <ul>
          <li> About </li>
          <li> Projects</li>
          <li> Resume </li>
          <li> Contact Me </li>
        </ul>
      </div>
    </div>
  );
}

export default Navbar;
